import React from 'react'
import './LoadingCell.css'
import {Spinner} from 'react-bootstrap'

const LoadingCell = ()=>{
    return(
        <div>
            <Spinner animation="border" role="status"/>
            <div className='load'>Loading</div>
        </div>

    )
}

export default LoadingCell;
